import React, { useState, useEffect } from 'react';

function App() {
  const [cars, setCars] = useState([]);
  const [carId, setCarId] = useState('');
  const [startTime, setStartTime] = useState('');
  const [endTime, setEndTime] = useState('');
  const [message, setMessage] = useState('');

  useEffect(() => {
    // In a real application, you would fetch available cars from the backend here.
    // Update the 'cars' state with the fetched data.
    // Example: fetchCarsFromBackend().then(data => setCars(data));
  }, []);

  const handleBooking = () => {
    // In a real application, you would send a booking request to the backend here.
    // Example: sendBookingRequestToBackend(carId, startTime, endTime)
    // On success, display a success message; on failure, display an error message.
    setMessage('Car booked successfully!');
  };

  return (
    <div>
      <h1>Car Rental Website</h1>
      <div>
        <h2>Available Cars</h2>
        <ul>
          {cars.map((car) => (
            <li key={car.id}>
              {car.name} - {car.bookedSlots.length === 0 ? 'Available' : 'Booked'}
            </li>
          ))}
        </ul>
      </div>
      <div>
        <h2>Book a Car</h2>
        <form>
          <label>
            Select a Car:
            <select value={carId} onChange={(e) => setCarId(e.target.value)}>
              <option value="">Select a car</option>
              {/* Populate this dropdown with available cars */}
            </select>
          </label>
          <br />
          <label>
            Start Time:
            <input
              type="text"
              value={startTime}
              onChange={(e) => setStartTime(e.target.value)}
            />
          </label>
          <br />
          <label>
            End Time:
            <input
              type="text"
              value={endTime}
              onChange={(e) => setEndTime(e.target.value)}
            />
          </label>
          <br />
          <button type="button" onClick={handleBooking}>
            Book Car
          </button>
        </form>
        {message && <p>{message}</p>}
      </div>
    </div>
  );
}

export default App;
